import React from 'react';
import './App.css';
import { Route, Routes } from 'react-router-dom';

import Main from './pages/main.js';

class App extends React.Component {
  constructor(props) {
    super(props);
    this.state = {};
  }

  render() {
    return (
      <div className="App">
        <Routes>
          <Route path="/" component={Main} />
        </Routes>
      </div>
    );
  }
}

export default App;
